import React from 'react';

export default function CardHeroes(props) {
    console.log(props.heroe);
    return (
        <div className="col-4">
            <div className="card">
                <div className="card-image">
                    <img src={props.image} alt={props.name} />
                </div>
                <div className="card-content">
                    <h3>{props.name}</h3>
                    <p>{props.description}</p>
                </div>
            </div>
        </div>
    );
}
